@Override
protected void setUp() throws Exception {
  super.setUp();
  InputStream is = getClass().getResourceAsStream("Lao.brk");
  wordIterator = new LaoBreakIterator(RuleBasedBreakIterator.getInstanceFromCompiledRules(is));
  is.close();
}

